    t[243] = "\u041a\u043e\u043d\u0444\u043b\u0438\u043a\u0442\u0443\u044e\u0449\u0438\u0435 \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f address helper";
    t[246] = "The outproxy is probably down, but there could also be network congestion.";
    t[247] = "\u0412\u043d\u0435\u0448\u043d\u0438\u0439 \u043f\u0440\u043e\u043a\u0441\u0438, \u0432\u0435\u0440\u043e\u044f\u0442\u043d\u043e, \u0432\u044b\u043a\u043b\u044e\u0447\u0435\u043d, \u043d\u043e \u0442\u0430\u043a\u0436\u0435 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u0430 \u043f\u0435\u0440\u0435\u0433\u0440\u0443\u0437\u043a\u0430 \u0441\u0435\u0442\u0438.";
    t[250] = "Continue without saving";
    t[251] = "\u041f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u044c \u0431\u0435\u0437 \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f";
    t[256] = "Warning: No Outproxy Configured";
    t[257] = "\u041f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435: \u0412\u044b\u0445\u043e\u0434\u043d\u043e\u0439 \u043f\u0440\u043e\u043a\u0441\u0438-\u0441\u0435\u0440\u0432\u0435\u0440 \u043d\u0435 \u043d\u0430\u0441\u0442\u0440\u043e\u0435\u043d";
    t[260] = "Addressbook";
    t[261] = "\u0410\u0434\u0440\u0435\u0441\u043d\u0430\u044f \u043a\u043d\u0438\u0433\u0430";
    t[266] = "Information: New Host Name";
    t[267] = "\u0418\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f: \u041d\u043e\u0432\u044b\u0439 \u0434\u043e\u043c\u0435\u043d\u043d\u043e\u0439 \u0430\u0434\u0440\u0435\u0441";
    t[268] = "You can browse to the site without saving it to the addressbook. The address will be remembered until you restart your I2P router.";
    t[269] = "\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0440\u043e\u0441\u043c\u043e\u0442\u0440\u0435\u0442\u044c \u0441\u0430\u0439\u0442, \u043d\u0435 \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u044f \u0435\u0433\u043e \u0432 \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0435. \u0410\u0434\u0440\u0435\u0441 \u0437\u0430\u043f\u043e\u043c\u043d\u0438\u0442\u0441\u044f \u0434\u043e \u0442\u0435\u0445 \u043f\u043e\u0440, \u043f\u043e\u043a\u0430 \u0432\u044b \u043d\u0435 \u043f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u0442\u0438\u0442\u0435 \u0441\u0432\u043e\u0439 \u043c\u0430\u0440\u0448\u0440\u0443\u0442\u0438\u0437\u0430\u0442\u043e\u0440 i2p.";
    t[276] = "Seeing this page often? See {0}the FAQ{1} for help in {2}adding some subscriptions{3} to your addressbook.";
    t[277] = "\u0427\u0430\u0441\u0442\u043e \u0432\u0438\u0434\u0438\u0442\u0435 \u044d\u0442\u0443 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0443? \u0415\u0441\u043b\u0438 \u0432\u044b \u0441\u043b\u0438\u0448\u043a\u043e\u043c \u0447\u0430\u0441\u0442\u043e \u043f\u043e\u043f\u0430\u0434\u0430\u0435\u0442\u0435 \u043d\u0430 \u044d\u0442\u0443 \u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0443, \u0442\u043e \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u0435\u0441\u044c \u043a {0}FAQ{1} \u0437\u0430 \u0438\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f\u043c\u0438 \u043f\u043e {2}\u0434\u043e\u0431\u0430\u0432\u043b\u0435\u043d\u0438\u044e \u043f\u043e\u0434\u043f\u0438\u0441\u043e\u043a{3} \u0430\u0434\u0440\u0435\u0441\u043d\u043e\u0439 \u043a\u043d\u0438\u0433\u0438.";
    t[286] = "Saved the authentication for {0}, redirecting now.";
    t[287] = "\u0414\u043b\u044f {0} \u0430\u0443\u0442\u0435\u043d\u0442\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0430, \u043f\u0435\u0440\u0435\u043d\u0430\u043f\u0440\u0430\u0432\u043b\u044f\u0435\u043c \u0434\u0430\u043b\u044c\u0448\u0435.";
    t[288] = "Destination LeaseSet not found";
